import "./App.css";
import Mensaje from "./components/Mensaje";
import Description from "./components/Description";

function App() {
  return (
    <div className="App">
      <Mensaje msg="Johan" />
      <Mensaje msg="Sebastian" />
      <Mensaje msg="Buitrago" />
      <Description />
    </div>
  );
}

export default App;
